import React from "react";
import { Container, Row, Col } from "reactstrap";
import Card from "../card";
import "./style.css";

const works = [
  {
    name: "Beautify",
    img: "/images/gif3.gif",

    description: "book with Beautify",
    link: "https://beautiffy.herokuapp.com/"
  },
  {
    name: "PinME",
    img: "images/site.gif",
    description: "pin your music events!",
    link: "https://javascriptkitty.github.io/the-first-big-project/"
  },
  {
    name: "Shocktail",
    img: "/images/shocktail.gif",
    description: "make your cocktail",
    link: "https://beautiffy.herokuapp.com/"
  },
  {
    name: "CRYSTALL COLLECTOR",
    img: "/images/gif2.gif",
    description: "play",
    link: "https://javascriptkitty.github.io/Crystal_Collector_game/"
  },
  {
    name: "RPG game",
    img: "/images/gif1.gif",
    description: "play",
    link: "https://javascriptkitty.github.io/RPG_Game/"
  },

  {
    name: "TRIVIA",
    img: "/images/gif4.gif",
    description: "play",
    link: "https://javascriptkitty.github.io/TriviaGame/"
  },
  {
    name: "Clicky game",
    img: "/images/gif5.gif",
    description: "play",
    link: "https://javascriptkitty.github.io/clicky_game/"
  },

  {
    name: "HANGMAN",
    img: "/images/gif6.gif",
    description: "play",
    link: "https://javascriptkitty.github.io/Word-Guess/"
  }
];

const Portfolio = () => {
  return (
    <section className="portfolio">
      <Container>
        <a name="portfolio"></a>
        <h1>Portfolio</h1>
        <div className="cards">
          {works.map(work => {
            return <Card key={work.name} data={work} />;
          })}
        </div>
      </Container>
    </section>
  );
};

export default Portfolio;
